description:
Verenigde Staten
Komedie / Horror
88 minuten

goed

met Woody Harrelson, Jesse Eisenberg en Emma Stone

Twee mannen genaamd Columbus (Jesse Eissenberg) en Tallahassee (Woody Harrelson) moeten zien te overleven in een wereld die 
overbevolkt is door zombies. Tijdens hun strijd met overleving bundelen ze krachten met Wichita (Emma Stone) en Little Rock 
(Abigail Breslin), die ook een manier hebben gevonden om in leven te blijven. Tijdens hun strijd moeten ze zich afvragen wat 
erger is, van elkaar afhankelijk moeten zijn of toch maar aan de zombies overgeven.
